import React from 'react';
import './Channel.css';

/**
* @param {Object} props - Channel Name
* @return {JSX} - Channel Page
*/
function Channel(props) {
  console.log(props.name);
  return (
    <div>
      <div id='channel-header'>
        <div id='bruh'>
          {props.name}
        </div>
      </div>
      <div id='channel-body'>
      </div>
    </div>
  );
}

export default Channel;
